import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Ajout.css';


class App extends Component {
  render() {
    return (
      <div className="cadre">
        <form action = "http://localhost:8080/list" method = "POST" className="form-inline">
            <div class="form-group">
              <label for="email">Nom:</label>
              <input type="text" name="nom"  placeholder="Nom" className="form-control"/>
            </div> 
            <div class="form-group" id="prenom">
              <label for="email">Prenom:</label>
              <input type="text" name="prenom"  placeholder="Prenom" className="form-control"/>
            </div>
            <input type="submit" value="Ajouter" className="btn btn-primary" id="ajout"/>	
        </form>
      </div>
    );
  }
}

export default App;
